import { Container, Navbar, Nav, Image } from "react-bootstrap";


function NavBar() {
    return (
        <Navbar bg="light" variant="light">
           <Container >
                <Nav.Link classhref="/">
                    <Image src="/fietslabyrint-logo.png" height="90" className="justify-content-start d-inline-block align-text-top" alt="logo" />
                </Nav.Link>
            </Container>
        </Navbar>
    );
}


export default NavBar;
